import React from "react";
import ReactDom from "react-dom";

function Card() {
  return (
    <div className="cards">
      <div className="card">
        <img src="Dark.jpg" alt="myPic" className="card-img" />
        <div className="card-info">
          <span className="card-category">Netflix Original series</span>
          <h3 className="card-title">Dark</h3>
          <a
            href="https://www.netflix.com/in/title/80990668?source=35"
            target="-blank"
          >
            <button>Watch Now</button>
          </a>
        </div>
      </div>
    </div>
  );
}

ReactDom.render(

<Card />, document.getElementById("root"));
